import React from 'react';
import {NavLink} from 'react-router-dom';
import Burger from './Burger';
import { useState } from 'react';




function Navbar(){
  const [hamburgerOpen, setHamburgerOpen] = useState(false);

    const toggleHamburger = () =>{
        setHamburgerOpen(!hamburgerOpen)
    }
  return (
    <div>
      <nav>
      <div class="logo"><img src="./logo2.png"  alt="logo" /></div>
        <ul className="links">
          <li><NavLink   to='/' exact activeClassName="active">Strona Główna</NavLink></li>
          <li><NavLink   to='/onas' activeClassName="active">O nas</NavLink></li>
          <li><NavLink   to='/oferta' activeClassName="active">Oferta</NavLink></li>
          <li><NavLink  to='/przedszkole' activeClassName="active">Przedszkole</NavLink></li>
          <li><NavLink   to='/aktualnosci' activeClassName="active">Aktualności</NavLink></li>
          <li><NavLink   to='/rekrutacja' activeClassName="active">Rekrutacja</NavLink></li>
          <li><NavLink  to='/kontakt' activeClassName="active">Kontakt</NavLink></li>
          
  
        </ul>
        <div class="links-mobile">
        <div className="hamburger" onClick={toggleHamburger}>
                        <Burger isOpen={hamburgerOpen}/>
                    </div>
        </div>
      </nav>
      <style jsx>{`
       @media (max-width: 1507px){
            nav{
              postion:fixed;
            }      
        nav .links-mobile .hamburger {
          
          display:flex;
          position:fixed;
          
          z-index: 6;
        }
    
       
        nav .links {
            display: ${hamburgerOpen ? 'inline' : 'none'};
            background-color: blue;
            height: 100vh;
            width: 50vw;
            margin-top: 50px;
            position: fixed;
            
        }
      }
        `}</style>
    </div>
  );
};
  
export default Navbar;
